import {Sidebar, Menu, MenuItem} from 'react-pro-sidebar'

const UserSidebar = () => {

    return (

	    <Sidebar>
	    <Menu>
	    <MenuItem> Home </MenuItem>
	    <MenuItem> Previous Workouts </MenuItem>
	    <MenuItem> Fitness Progress </MenuItem>
	    </Menu>
	    </Sidebar>

    )
}

export default UserSidebar
